async function getDelegateAddress(tokenAddress,selectedAccount){let GTCContract=new web3.eth.Contract(gtc_token_abi,tokenAddress);try{delegate_address=GTCContract.methods.delegates(selectedAccount).call({from:selectedAccount});}catch(e){console.error('Could not get Delegate Address: ',e);return;}
return delegate_address;}
async function getCurrentVotes(tokenAddress){let GTCContract=new web3.eth.Contract(gtc_token_abi,tokenAddress);try{current_votes=GTCContract.methods.getCurrentVotes(selectedAccount).call({from:selectedAccount});}catch(e){console.error('Could not get prior votes: ',e);return;}
return current_votes;}
async function getPriorVotes(tokenAddress,account,block_number){let GTCContract=new web3.eth.Contract(gtc_token_abi,tokenAddress);try{past_votes=GTCContract.methods.getPriorVotes(account,block_number).call({from:selectedAccount});}catch(e){console.error('Could not get prior votes: ',e);return;}
return past_votes;}
async function setDelegateAddress(_delegateAddress,tokenAddress){let GTC=new web3.eth.Contract(gtc_token_abi,tokenAddress);try{const setDelegate=()=>{GTC.methods.delegate(_delegateAddress).send({from:selectedAccount,gasLimit:'300000'}).on('transactionHash',async function(transactionHash){updateInterface('pending',transactionHash);console.debug('ON TRANSACTION HASH - PENDING',transactionHash);}).on('confirmation',(confirmationNumber)=>{if(confirmationNumber>=0){updateInterface('success');console.debug('ON CONFIRMATION');}}).on('error',(error)=>{updateInterface('error');console.error('Error setting delegate address:',error);});};setDelegate();}catch{console.error('Error setting delegate address!');}}
async function isClaimed(user_id){const TokenDistributor=new web3.eth.Contract(token_distributor_abi,token_distributor_address());try{is_claimed=TokenDistributor.methods.isClaimed(user_id).call({from:selectedAccount});}catch(e){console.error('Could not get claim state from TokenDistributor: ',e);return;}
return is_claimed;}
async function proposalState(){const GovernorAlpha=new web3.eth.Contract(governor_alpha_abi,governor_alpha_address());try{proposal_count=await GovernorAlpha.methods.proposalCount().call({from:selectedAccount});}catch(e){console.error('Could not get proposalCount from GovernorAlpha: ',e);return;}
var proposal_states={Pending:0,Active:0,Canceled:0,Defeated:0,Succeeded:0,Queued:0,Expired:0,Executed:0};for(let proposal=1;proposal<=proposal_count;proposal++){try{proposal_status=await GovernorAlpha.methods.state(proposal).call({from:selectedAccount});}catch(e){console.error('Could not get proposal state from GovernorAlpha: ',e);return;}
bumpCounts(proposal_status);}
return proposal_states;function bumpCounts(status){if(status==0){proposal_states.Pending+=1;}else if(status==1){proposal_states.Active+=1;}else if(status==2){proposal_states.Canceled+=1;}else if(status==3){proposal_states.Defeated+=1;}else if(status==4){proposal_states.Succeeded+=1;}else if(status==5){proposal_states.Queued+=1;}else if(status==6){proposal_states.Expired+=1;}else if(status==7){proposal_states.Executed+=1;}}}
